import React from 'react';

export const Transaction = ({transaction}) => {
    return(
        <li className='minus' key={transaction.id}> {transaction.text} 
            <span>{transaction.amount}</span><button className='delete-btn'>&times;</button>
        </li>
    )
}

export default Transaction;
